function InputCity({onSubmitHandler,city,onInputHandler}){



    return(

      <div className='input'>
      <input type= "text"
       value = {city}
       onChange = {onInputHandler}
       placeholder = "City Name"
       />
        <br/>

        <button className='input_button' type='submit' onClick={onSubmitHandler}>
                Search
        </button>
      </div>
)}


export default InputCity;
